INSERT INTO `dm_news` VALUES ('040e5bcf4d1a41d78e3d8e949c1d0964', 'a8b00e2816ef420e8be73d73ed61bc77', '从禅茶的慈悲，到慈悲的茶禅锻炼行人得禅真谛', '/mall/userfiles/1/images/news/dmNews/2017/05/Jellyfish.jpg', '&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;从禅茶的慈悲到慈悲的茶禅&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&lt;br/&gt;　文/蒋劲松&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&lt;br/&gt;　　虽然茶禅以智慧著称，但是没有慈悲的智慧算不得真正的智慧。佛门向来讲究悲智双运。慈悲与智慧如鸟之双赢，车之双轮。唯有深刻领会茶禅的慈悲，才可以真正领会茶禅的智慧。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&lt;br/&gt;　　什么是禅茶？禅作为佛法的心髓，难以下手，即使饱读经论的佛教行人也未必能够入门，遑论普通大众？所以慈悲的祖师们大开方便之门，让人们以茶入禅。茶本为人们日常饮用之物，无论一个人的社会地位高低，学问有无，何种信仰，品行如何，都可以喝茶。不拘何种根性，是否杀盗淫妄，都可以通过茶的媒介来接触禅的智慧，体会禅的慈悲，因为一切众人皆有佛性。这种在禅的精神指导下的茶，引人入禅的茶，帮助众人开发佛性的茶，让人启迪智慧，长养慈悲的茶，就已经超越了作为普通饮用物的茶，是一种升华了的茶，这就是禅茶。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　什么是禅茶的慈悲？禅茶接引的普遍包容，是从慈悲心中开发的善巧方便。不设任何门槛，欢喜接纳一切人，如和煦的春风，给予人们以关怀，寓教化于享受之中，这是禅茶的大善巧，也是禅茶的大慈悲。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&lt;br/&gt;　　什么是茶禅？以茶为方便、为媒介的禅修，二六时中不离这个，处处观照自心，留心脚下，念念不空过，时时皆有禅，彻见本性，破除无明，打碎我人众生寿者见，领悟心佛众生三无差别。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　&lt;/span&gt;什么是茶禅的慈悲？真正领悟了茶禅之道，自然会认识到：&ldquo;我肉众生肉，名殊体不殊，原同一种性，只是别形躯。&rdquo;禅门常讲：&ldquo;狗子也有佛性&rdquo;。因此，看似与人类毫无关系的动物，看似低人一等的动物，其实和我们一样都是在六道中轮回的众生，佛性无二无别。在无始的轮回中，我们自己也曾经多次转世为动物，今天的动物，在无始的轮回中也都曾做过我们的父母兄弟姊妹夫妻老师同学。有了这样的认识，我们怎么可能还忍心去杀害虐待动物？我们还怎么可能忍心去吃肉？我们自然会加入到护生动保行列中，去呵护、关怀那些需要救助的动物。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&lt;br/&gt;　　因此，真正的茶禅，如果不是附庸风雅，不是挂羊头卖狗肉，对历代修行人的禅修真有一份敬意的话，真能领会心佛众生三无差别，一定会尊重禅客的慈悲精神，不忍啖肉，一定会逐步远离膻腥，慈悲茹素，并进而支持一切动保护生行为的。时时长养慈悲心，这是茶禅的大智慧，也是茶禅的大慈悲。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&lt;br/&gt;　　禅茶的慈悲表现为对众人接引的无遮普覆，我们应该时时留心，是否给人欢喜，是否善巧方便地与众生结缘，禅茶如春风和煦，对众人无限的包容，慷慨布施，爱语安慰，利行同事，广度有情。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&lt;br/&gt;　　茶禅的慈悲表现为对众生关怀的无遮普覆，我们必须要省察自己的行为是否时时以众生利益为念，茶禅如壁立千仞，对自己无限的严格，诸恶莫作，众善奉行，自净其意，究竟成佛。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&lt;br/&gt;　　禅茶的慈悲，是基础，引导人们入禅之门；茶禅的慈悲，是升华，锻炼行人得禅真谛。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&lt;br/&gt;　　从禅茶的慈悲，到慈悲的茶禅，是慈悲的深化和扩展，从对人类的慈悲扩展到对一切众生的慈悲。虽然有名目的差异，有对机的不同，但本质上都是无分别心的具体体现，都是无缘大慈同体大悲的自然流露。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '1', '1', '2017-05-23 15:27:15', '1', '2017-05-29 10:54:45', null, '0');
INSERT INTO `dm_news` VALUES ('3e8ca334ce4a4e7a8fb66da9b771877b', '2d3d12bc3e0c4fb0bcf30dbd6542e237', '以茶为师 岁月的涮洗才锻炼我们的芳香', '/mall/userfiles/1/images/news/dmNews/2017/05/Desert.jpg', '&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; 在一壶茶里，每一片茶叶都不重要，因为少了一片，仍然是一壶茶。但是，每一片茶叶也都非常重要，因为每一滴水的芬芳，都有每一片茶叶的生命本质。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　布施不是如此吗？布施，犹如加一片茶叶到一大壶茶里，少了我的这一片，看似不影响茶的味道；其实不然，丢进我的这一片，一壶茶都有了我的芳香。虽然我能施的很小，也会充满每一滴水。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　布施，我们应以茶叶为师，最上好的茶叶，五六斤茶青才能制成一斤茶，而每一片茶都是泡在壶里能还原，能温润，才有作为茶叶的生命意义；我们也是一样，要经过许多岁月的涮洗才锻炼我们的芳香，而且只有在奉献时，我们才有了人的温润，有生命的意义。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　一片茶叶丢到壶里就被遗忘了，喝的人在欢喜一壶茶时并不会赞叹单独的一片茶叶。一片茶叶是不求世间名誉的，这就是以清净的心布施，不求功德，不求福报，只是尽心尽意贡献自己的芳香。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　一壶好茶，是每一片茶叶共同创造的净土。正如《维摩经》说：&ldquo;布施，是菩萨净土。&rdquo;欲行布施，先学习心在社会这壶茶里，做一片茶叶！说珍惜世界，先珍惜每一片茶叶！&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '2', '1', '2017-05-23 15:28:36', '1', '2017-08-23 17:34:47', null, '0');
INSERT INTO `dm_news` VALUES ('5164f09678c84014bed8ecb8228c00ed', '80905dd5b4514f6eadf0d3d257b739ec', '藏传佛教与茶的渊源禅茶文化', '/mall/userfiles/1/images/news/dmNews/2017/05/Desert.jpg', '&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;藏传佛教徒与茶的渊源&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　&amp;nbsp; 佛教在东汉时期传入我国， 饮茶之风才开始主见与禅相结合，并且通过社会的进步，&lt;a href=&quot;http://undefined&quot; target=&quot;_blank&quot; style=&quot;color: rgb(86, 86, 86); outline: none 0px;&quot;&gt;&lt;strong&gt;茶文化&lt;/strong&gt;&lt;/a&gt;与禅的关系也在不断的发展深化。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　佛教中的&ldquo;禅&rdquo;是梵语&ldquo;禅那&rdquo;的音译，意为静坐修行。要求修行者止静敛心专注一境。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　藏族地区饮茶始于何时，学术界尚未形成一个权威的结论。但绝大多数的学者都认为：对茶的认识在吐蕃时期已经开始逐步传播。据《汉藏史集》记载：噶米王（赤松德赞）向汉地僧人学会了烹茶，米扎贡又向噶米王学会了烹茶，这以后便依次传了下来。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　后来又不断有大批汉族禅僧入藏传法或经吐蕃去印度求法，将内地烹茶的方法和饮茶的习俗直接传给了藏地的僧人。加之吐蕃王朝的热巴巾赞普（815-838年）开展的尊佛运动，使藏地喇嘛的社会地位大大提升，无形中促进了寺院中饮茶之风的向外传播。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　吐蕃王朝最后一位赞普郎达玛（公元839-842年在位）实施灭佛运动，许多僧人被迫还俗，再次促进了寺院中的饮茶之风和烹茶之法向普通百姓中的传播。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　史诗《格萨尔王传》中有王妃珠牡，边舞边唱，向众英雄敬茶的记载，她的唱词包括茶的源起、酥油茶制作方法、功效等，反映出了茶在藏族精神世界中的重要地位；藏传佛教以普世情怀浸淫信徒，所以极为重视与信徒间的精神沟通。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　因此二者的共同作用自然而然地构成了藏传佛教极力推崇饮茶的重要原因。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '3', '1', '2017-05-23 15:27:39', '1', '2017-05-29 10:54:39', null, '0');
INSERT INTO `dm_news` VALUES ('623fe55d5b3d48e091932fc1d4814f91', '2d3d12bc3e0c4fb0bcf30dbd6542e237', '123123123', '/mall/userfiles/1/images/news/dmNews/2017/05/Desert.jpg', '&lt;iframe height=498 width=510 src=\'http://player.youku.com/embed/XMjc3MjIxNjAyOA==\' frameborder=0 \'allowfullscreen\'&gt;&lt;/iframe&gt;', '4', '1', '2017-05-30 09:49:08', '1', '2017-05-30 09:51:22', null, '0');
INSERT INTO `dm_news` VALUES ('939e391a210b4b5396aca3a8e4d5f5d8', '66f64fe014774e1389e20974776c04f7', '中华茶道的四要素环境、礼法、茶艺、修行', '/mall/userfiles/1/images/news/dmNews/2017/05/Jellyfish.jpg', '&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;禅茶：中华茶道的四要素&lt;br/&gt;&amp;nbsp;&lt;br/&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;strong&gt;&amp;nbsp;（一）环境&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&lt;strong&gt;&lt;/strong&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　&lt;a href=&quot;http://undefined&quot; target=&quot;_blank&quot; style=&quot;color: rgb(86, 86, 86); outline: none 0px;&quot;&gt;&lt;strong&gt;茶道&lt;/strong&gt;&lt;/a&gt;是在一定的环境下所进行的茶事活动，茶道对环境的选择、营造尤其讲究，旨在通过环境来陶冶、净化人的心灵，因而需要一个与茶道活动要求相一致的环境。茶道活动的环境不是任意、随便的，而是经过精心的选择或营造。茶道环境有三类，一是自然环境，如松间竹下，泉边溪侧，林中石上。二是人造环境，如僧寮道院、亭台楼阁、画舫水榭、书房客厅。三是特设环境，即专门用来从事茶道活动的茶室。茶室包括室外环境和室内环境，茶室的室外环境是指茶室的庭院，茶室的庭院往往栽有青松翠竹等常绿植物及花木。室内环境则往往有挂画、插花、盆景、古玩、文房清供等。尤其是挂画、插花，必不可少。总之，茶道的环境要清雅幽静，使人进入到此环境中，忘却俗世，洗尽尘心，熏陶德化。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　&lt;strong&gt;　（二）礼法&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　茶道活动是要遵照一定的礼法进行，礼既礼貌、礼节、礼仪，法即规范、法则。&ldquo;夫珍鲜馥烈者，其碗数三，次之者，碗数五。若坐客数至五，行三碗。至七，行五碗。若六人已下，不约碗数，但阙一人，而已其隽永补所阙人。&rdquo;（陆羽《茶经》&ldquo;五之煮&rdquo;）此为唐代煎茶道中的行茶规矩。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　&ldquo;童子捧献于前，主起举瓯奉客日：为君以泻清臆。客起接，举瓯曰：非此不足以破孤闷。乃复坐。饮毕，童子接瓯而退。话久情长，礼陈再三。&rdquo;（朱权《茶谱》序）此为宋明点茶道主、客间的端、接、饮、叙礼仪，颇为谨严。礼是约定俗成的行为规范，是表示友好和尊敬的仪容、态度、语言、动作。茶道之礼有主人与客人、客人与客人之间的礼仪、礼节、礼貌。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　茶道之法是整个茶事过程中的一系列规范与法度，涉及到人与人、人与物、物与物之间一些规定，如位置、顺序、动作、语言、姿态、仪表、仪容等。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　茶道的礼法随着时代的变迁而有所损益，与时偕行。在不同的茶道流派中，礼法有不同，但有些基本的礼法内容却是相对固定不变的。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　&lt;strong&gt;（三）茶艺&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　&lt;a href=&quot;http://undefined&quot; target=&quot;_blank&quot; style=&quot;color: rgb(86, 86, 86); outline: none 0px;&quot;&gt;&lt;strong&gt;茶艺&lt;/strong&gt;&lt;/a&gt;即饮茶艺术，茶艺有备器、择水、取火、侯汤、习茶五大环节，首先以习茶方式划分，古今茶艺可划分为煎茶茶艺、点茶茶艺、泡茶茶艺；其次以主茶具来划分，则可将泡茶茶艺分为壶泡茶艺、工夫茶艺、盖碗泡茶艺、玻璃杯泡茶艺、工夫法茶艺。再次则以所用茶叶来划分。工夫茶艺依发源地又可划分为武夷工夫茶艺、武夷变式工夫茶艺、台湾工夫茶艺、台湾变式工夫茶艺。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　茶艺是茶道的基础和载体，是茶道的必要条件。茶道离不开茶艺，茶道依存于茶艺，舍茶艺则无茶道。茶艺的内涵小于茶道，但茶艺的外延大于茶道。茶艺可以独立于茶道而存在，作为一门艺术，也可以进行舞台表演。因此说，表演茶艺或茶艺表演是可以的，但说茶道表演或表演茶道则是不妥的。因为，茶道是供人修行的，不是表演给别人看的，可表演的是茶艺而不是茶道。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　&lt;strong&gt;（四）修行&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　修行是茶道的根本，是茶道的宗旨，茶人通过茶事活动怡情悦性、陶冶情操、修心悟道。中华茶道的修行为&ldquo;性命双修&rdquo;，修性即修心，修命即修身，性命双修亦即身心双修。修命、修身，也谓养生，在于祛病健体、延年益寿；修性、修心在于志道立德、怡情悦性、明心见性。性命双修最终落实于尽性至命。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 闂佽娴烽幊鎾活敄閸曨厾绀婇柨鐕傛嫹; line-height: normal; white-space: normal;&quot;&gt;　　中华茶道的理想就是养生、怡情、修性、证道。证道是修道的结果，是茶道的理想，是茶人的终极追求，是人生的最高境界。茶道的宗旨、目的在于修行，环境亦好，礼法亦好，茶艺亦好，都是为着一个目的&mdash;&mdash;修行而设，服务于修行。修行是为了每个参加者自身素质和境界的提高，塑造完美的人格。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '6', '1', '2017-05-23 15:28:09', '1', '2017-05-29 10:54:33', null, '0');
